export default function Photos({ photos }) {
  console.log("Photos", photos);
  return (
    <div className="h-16 border-t border-gray-primary mt-12 pt-4">Holaa</div>
  );
}
Photos.propTypes = {
  photos: PropTypes.array.isRequired,
};
